"/aktivitaeten/BDM-2025-05/43_05-2025.jpg",J="/aktivitaeten/BDM-2025-05/44_05-2025.jpg",K="/aktivitaeten/BDM-2025-05/45_05-2025.jpg",U="/aktivitaeten/BDM-2025-05/46_05-2025.jpg",Y="/aktivitaeten/BDM-2025-05/47_05-2025.jpg",y="/aktivitaeten/BDM-2025-05/48_05-2025.jpg",$="/aktivitaeten/BDM-2025-05/49_05-2025.jpg",ee="/aktivitaeten/BDM-2025-05/50_05-2025.jpg",te="/aktivitaeten/BDM-2025-05/51_05-2025.jpg",ae="/aktivitaeten/BDM-2025-05/52_05-2025.jpg",ie="/aktivitaeten/BDM-2025-05/53_05-2025.jpg",re="/aktivitaeten/BDM-2025-05/54_05-2025.jpg",ne="/aktivitaeten/BDM-2025-05/55_05-2025.jpg",se="/aktivitaeten/BDM-2025-05/56_05-2025.jpg",de="/aktivitaeten/BDM-2025-05/57_05-2025.jpg";const oe={},me=i('<h1 id="bilder-des-monats-mai-2025" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-mai-2025" aria-hidden="true">#</a> Bilder des Monats Mai 2025</h1><p>DO1HFS ist aktuell viel mit dem Pedelec portabel unterwegs und passt seine Ausr\xFCstung entsprechend an.</p><p><img src="'+r+'" alt="Bilder des Monats"><img src="'+n+'" alt="Bilder des Monats"><img src="'+s+'" alt="Bilder des Monats"><img src="'+d+'" alt="Bilder des Monats"><img src="'+o+'" alt="Bilder des Monats"><img src="'+m+'" alt="Bilder des Monats"></p><p>Heute hat DB6NL im Rahmen vom DARC UKW Contest den Park DE-0959 auf 2m in SSB aktiviert. Mit 10W kamen 20 QSOs in 1,5h ins Log. Weitestes QSO war mit PA1T \xFCber eine Entfernung von 210km.</p><p><img src="'+p+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"></p><p>Am 03.05.2025 startete das neue Programm &quot;Bunkers on the Air - Deutschland&quot;, also wurde nicht nur POTA sondern auch BOTA aktiviert. Zwei POTA Parks und 5 BOTA Bunker wurden erfolgreich aktiviert. Man h\xE4tte gerne noch weiter gemacht, aber gegen 18 Uhr Lokalzeit zog ein dickes Gewitter auf und zwang uns zum Abbau. Auf den B\xE4ndern waren wir mit den Calls &quot;DA6TW&quot; und &quot;DL3CR&quot; zu h\xF6ren.</p><p><img src="'+_+'" alt="Bilder des Monats"><img src="'+l+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+B+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"></p><p>Ich (DB6NL) hab eine Radtour zu Muttern genutzt um DE-0803 auf dem Weg zu aktivieren. Die Bandbedingungen waren eher mau und f\xFCr 10 QSOs brauchte ich fast 2h. Zum Gl\xFCck wird Erdbeerkuchen nicht kalt, da ich doch einwenig versp\xE4tet zum Muttertagskaffeetrinken kam\u2026</p><p><img src="'+u+'" alt="Bilder des Monats"><img src="'+h+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"></p><p>Heute hatte ich kurz Zeit,etwas portable Betrieb zu machen. Mit dem MTB gings auf 1100m,zum Pavillon oberhalb von Oberstdorf. Mit dabei war der Xiegu 6100,12m Draht f\xFCr 10,20&amp;40m. \u{1F601}</p><p><img src="'+j+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"><img src="'+b+'" alt="Bilder des Monats"><img src="'+w+'" alt="Bilder des Monats"><img src="'+z+'" alt="Bilder des Monats"></p><p>DO1HFS verbindet gleich drei Drau\xDFenaktivit\xE4ten miteinander. Pedelec fahren, angeln und funken. Das ganze am Waginger See, der gleichzeitig auch noch ein POTA Spot ist. Hier auf den Fotos zusehen: PAC-12/JPC-12 Antenne und im Rucksack ein Yaesu FT-857D.</p><p><img src="'+S+'" alt="Bilder des Monats"><img src="'+A+'" alt="Bilder des Monats"><img src="'+P+'" alt="Bilder des Monats"><img src="'+W+'" alt="Bilder des Monats"></p><p>DL2MBN zweite CW Pota Aktivierung:</p><p>4 Monate hat es gedauert CW zu lernen um vern\xFCnftig Rufzeichen zu h\xF6ren und ein Standard POTA QSO zu f\xFChren. Heute war es Zeit f\xFCr die zweite Aktivierung in CW. Die Space Wetter Vorschau war nicht so \xFCberragend SFI 117, SN 67, Kp3, aber was soll\u2019s bei gutem Wetter kann ja jeder \u201Ehi\u201C .</p><p>Also ging es zu einem 4 FER ( DE-0564, DE-0964, DE-0963, DE-0965 ) Eingepackt habe ich die EFHW f\xFCr 80-15m einen QMX 5 Watt TRX meinen Spiderbeam 7m Mast und 16 ah Eremit power ( damit h\xE4tte ich eine Woche funken k\xF6nnen)</p><p>Vor Ort war ich in 20 Minuten, der Aufbau ging schnell von der Hand, QMX auf 20 WPM eingestellt und los gehts. Nach ca 15 Minuten CQ Pota rufen dann endlich mein erstes QSO nach Frankreich, es ging schleppend voran bis auf ein mal das 20 m Band besser wurde. Nach 1 1/2 Stunden hatte ich dann 27 qsos im Logbuch, gefunkt habe ich auf 20 und zum Schluss auf 40m. Beides mal wurde ich von DJ4RAM gehunted ( DF2DF ) was mich sehr gefreut hat. Somit hat die CW Welt einen begeisterten CW OP mehr. Es macht unglaublich viel Spa\xDF QRP bei solch schlechten Bedingungen QSOS zu f\xFChren. Mein besonderer Dank geht auch an DF2GN der mich die letzten Monate immer wieder motiviert hat, danke auch f\xFCr deine tolle Spot Empfehlung heute. Ich kann es nur jedem ans Herz legen der die Idee hat CW zu lernen, fangt an es es lohnt sich so extrem ! Somit verabschiede ich mich und bedanke mich bei allen Huntern die mir geholfen haben heute meine pota Aktivierung erfolgreich zu beenden.</p><p>73 DL2MBN e e</p><p><img src="'+E+'" alt="Bilder des Monats"><img src="'+L+'" alt="Bilder des Monats"><img src="'+O+'" alt="Bilder des Monats"><img src="'+C+'" alt="Bilder des Monats"><img src="'+T+'" alt="Bilder des Monats"><img src="'+F+'" alt="Bilder des Monats"><img src="'+Q+'" alt="Bilder des Monats"><img src="'+H+'" alt="Bilder des Monats"><img src="'+R+'" alt="Bilder des Monats"><img src="'+N+'" alt="Bilder des Monats"></p><p>Bei schwierigen Bedingungen hat Peter DL6PL die Besenhorster Sandberge (DE-0722) aktiviert. Am Ende gingen 23 Telegraphie-QSOs auf 20 m und ein paar SSB-Park2Parks auf 40 m ins Log.</p><p><img src="'+q+'" alt="Bilder des Monats"><img src="'+I+'" alt="Bilder des Monats"><img src="'+x+'" alt="Bilder des Monats"><img src="'+V+'" alt="Bilder des Monats"></p><p>Aktivierung von zwei Parks (DE-0192 und DE-0919) und 4 Bunkern (B/DL-0245, B/DL-0246, B/DL-0247 und B/DL-0248) am 18.05.25 von DA6TW auf den B\xE4ndern 2m, 15m und 80m inkl. Antennentest.</p><p><img src="'+G+'" alt="Bilder des Monats"><img src="'+X+'" alt="Bilder des Monats"><img src="'+Z+'" alt="Bilder des Monats"><img src="'+J+'" alt="Bilder des Monats"><img src="'+K+'" alt="Bilder des Monats"><img src="'+U+'" alt="Bilder des Monats"></p><p>Ich war voriges Wochenende in Lettland und habe dort ein paar Parks aktiviert als YL/M0OGC</p><p>In den 3 Tagen hab ich insgesamt 4 Aktivierungen geschafft von 2 Parks; LV-0013 &amp; LV-0002</p><p><img src="'+Y+'" alt="Bilder des Monats"><img src="'+y+'" alt="Bilder des Monats"><img src="'+$+'" alt="Bilder des Monats"><img src="'+ee+'" alt="Bilder des Monats"><img src="'+te+'" alt="Bilder des Monats"><img src="'+ae+'" alt="Bilder des Monats"><img src="'+ie+'" alt="Bilder des Monats"></p><p>Ich habe heute meine erste Fahrradtour gemacht und eine Aktivierung versucht. Leider ist das Wetter recht schnell umgeschlagen und ich musste abbrechen. DE-0192 und DE-0919</p><p><img src="'+re+'" alt="Bilder des Monats"><img src="'+ne+'" alt="Bilder des Monats"><img src="'+se+'" alt="Bilder des Monats"><img src="'+de+'" alt="Bilder des Monats"></p>',28),pe=[me];function ge(_e,le){return t(),a("div",null,pe)}var ve=e(oe,[["render",ge],["__file","2025-05-30-Bilder-Des-Monats-Mai.html.vue"]]);export{ve as default};
